import React from "react";
import './banner.css';

function Banner() {
    return (
       <a>  <div className="banner">
            <div className="banner-content">
                <div className="left-text">
                    <h1></h1>
                    <p></p>
                </div>
                <div className="right-text">
                    <h1></h1>
                    <p></p>
                </div>
            </div>
        </div>
        </a>
    );
}

export default Banner;
